import { useEffect } from 'react';
import { appTitle } from '../globals/globals';
import WorkInfo from '../components/WorkInfo';

const PageWorkDetail = ({title}) => {

    useEffect(() => {
        document.title = `${appTitle}`;
    }, []);

    return (
        <div>
            <WorkInfo/>
        </div>
    );

};

export default PageWorkDetail;
